import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './components/Home.jsx';
import Partners from './components/Partners';
import AddPartner from './components/AddPartner';
import EditPartner from './components/EditPartner';
import Products from './components/Products';
import AddProduct from './components/AddProduct';
import EditProduct from './components/EditProduct';
import Invoices from './components/Invoices';
import AddInvoice from './components/AddInvoice';
import InvoiceReport from './components/InvoiceReport';
import Transactions from './components/Transactions';
import AddTransaction from './components/AddTransaction';
import Ledger from './components/Ledger';

function App() {
  return (
    <BrowserRouter
      future={{
        v7_startTransition: true, // لتجنب تحذيرات React Router v7
        v7_relativeSplatPath: true,
      }}
    >
      <Routes>
        {/* الصفحة الرئيسية */}
        <Route path="/" element={<Home />} />

        {/* مسارات الشركاء */}
        <Route path="/partners/:type" element={<Partners />} />
        <Route path="/partners/:type/add" element={<AddPartner />} />
        <Route path="/partners/:type/edit/:id" element={<EditPartner />} />

        {/* مسارات المنتجات */}
        <Route path="/products" element={<Products />} />
        <Route path="/products/add" element={<AddProduct />} />
        <Route path="/products/edit/:id" element={<EditProduct />} />

        {/* مسارات الفواتير */}
        <Route path="/invoices/:type" element={<Invoices />} />
        <Route path="/invoices/:type/add" element={<AddInvoice />} />
        <Route path="/invoices/:type/view/:id" element={<InvoiceReport />} />

        {/* مسارات المعاملات (المدفوعات والإيصالات) */}
        <Route path="/transactions/:type" element={<Transactions />} />
        <Route path="/transactions/:type/add" element={<AddTransaction />} />

        {/* دفتر الحسابات */}
        <Route path="/ledger" element={<Ledger />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
